import React from "react";
import clock from "../../Images/TicketWrapper/clock.svg";
import flag from "../../Images/TicketWrapper/flag.svg";
const TicketWrapper = () => {
  const labels = [
    "Билет на целый день",
    "Неограниченное число катаний",
    "6 остановок у главных достопримечательностей",
    "Ближайший рейс сегодня",
  ];
  const times = ["09:00", "12:00", "15:00", "18:00"];
  const labelsComponent = [];
  const timesComponent = [];

  for (let i = 0; i < labels.length; i++) {
    labelsComponent.push(
      <div>
        <img src={flag}></img>
        <p>{labels[i]}</p>
      </div>
    );
    timesComponent.push(<div>{times}</div>);
  }
  return (
    <section>
      <div>
        <div>НОВИНКА</div>
      </div>
      <img src={clock}></img>
      <label>2 часа</label>
      <label>
        АКЦИЯ - Обзорная экскурсия по рекам и каналам с остановками Hop on Hop
        Off 2019
      </label>
      <div>
        <div>
          <img></img>
          <p></p>
        </div>
        <p></p>
        <p></p>
        <p></p>
      </div>
      <div>
        <div></div>
        <div></div>
        <div></div>
        <div></div>
      </div>
      <div>
        <div>
          <p></p>
          <label></label>
        </div>
        <button></button>
      </div>
    </section>
  );
};

export default TicketWrapper;
